#
# View "view_clientes"
#

DROP VIEW IF EXISTS `view_clientes`;
CREATE
  ALGORITHM = UNDEFINED
  VIEW `view_clientes`
  AS
SELECT
  `cli`.`id`,
  `cli`.`nome`,
  `c`.`name` AS 'cidade',
  `uf`.`uf`,
  `cli`.`created_at`
FROM
  ((`doador` cli
    LEFT JOIN `estados` uf ON (`uf`.`id` = `cli`.`uf`))
    LEFT JOIN `cidades` c ON (`c`.`id` = `cli`.`cidade`))
ORDER BY `cli`.`id` DESC;

#
# View "view_users"
#

DROP VIEW IF EXISTS `view_users`;
CREATE
  ALGORITHM = UNDEFINED
  VIEW `view_users`
  AS
SELECT
  `u`.`id`,
  `u`.`name`,
  `u`.`email`,
  `u`.`file`,
  `u`.`avatar`,
  `u`.`status`,
  `r`.`id` AS 'role_id',
  `r`.`name` AS 'role_name'
FROM
  ((`users` u
    JOIN `role_user` ru ON (`ru`.`user_id` = `u`.`id`))
    JOIN `roles` r ON (`r`.`id` = `ru`.`role_id`))
WHERE
  `u`.`status` <> 'E';
